// import components
import Header from './components/Header';
import Contact from './components/Contact';
import Thankyou from './components/Thankyou';

import './App.css';

function App() {
  return (
    <div className="App">
      <Header />
      <Contact />
      <Thankyou />

      <h1>Landing Page </h1>
    </div>
  );
}

export default App;
